import React, {Component} from "react";
import {withProvider} from "../GlobalProvider.js";


class SavedPage extends Component{

    constructor(){
        super();
        this.state = {
            user:''
        }
    }

    render(){
        return (
            <div>
                <p>Welcome {this.state.user}</p>
            </div>
        );
    }
}

export default withProvider(SavedPage)
